from collections import defaultdict

class ValidWordAbbr:

    def abbr(self, word: str) -> str:
        if len(word) > 2:
            r = word[0] + str(len(word)-2) + word[-1]
        else:
            r = word
        return r


    def __init__(self, dictionary: list[str]):
        d = defaultdict(str)
        for w in dictionary:
            a = self.abbr(w)
            if a in d.keys() and w != d[a]:
                d[a] = '*'
            else:
                d[a] = w
        self.d = d
        #print(d)
        

    def isUnique(self, word: str) -> bool:
        a = self.abbr(word)
        if a in self.d:
            if word == self.d[a]:
                return True
            else:
                return False
        return True



